.main-wrap {
    width:300px;
    margin:0 auto;
    position: relative;
}
.point {
    position: absolute;
    width: 12px;
    height: 12px;
    background-color: #f7ad9a;
    border-radius: 50%;
    border: 3px red solid;
    top: 0;
    left: 0;
    cursor: pointer;
    /*display: none;*/
}
.point.srinagar {
    top: 70px;
    left: 190px;
}
.eye:hover .point {
    background-color: white;
}
.abc {
    position: absolute;
    top: 0;
    right: 0;
}
path.eye:hover .abc {
    opacity: 0
}
svg:hover .nose {
    opacity: 0.1
}
